Returns a new object as a child of the current _this object.Creates a child of the object it is called on, not always _this. 
 example: 
 var FS = _this.CreateChild(OBJ_PART, 'FS', 'JS Fixed Shelf');

Creates a choice list for the given parameter 
 example: 
 _this.CreateChoiceList('PAR_CHOICE', 'Medium=50|Big=99|Small=1', VAL_INTEGER);

Evaluate a CV equation utilizing object parameters 
 example: 
 var volume = _this.Evaluate('DX * DY * DZ');

Evaluate a CV condition utilizing object parameters 
 example: 
 var result = _this.EvaluateCondition('DY > 5');

Locate an assembly utilizing the CV object path 
 example: 
 var result = _this.FindAssembly(':AS@3');

Format text utilizing the CV text variable parameter substitution mechanism 
 example: 
 var result = _this.FormatText('WIDTH{DX}');

Return the first object tree child of the current object 
 example: 
 var result = _this.GetFirstChild();

Return the next sibling in the object tree from the given object 
 example: 
 var result= _this.GetNextSibling();

Return the value of the given parameter 
 example: 
 var result = _this.GetParameterValue('DX');

Return the parent of the current object 
 example: 
 var result = _this.GetParent();

Determine if the given parameter exists on the current object 
 example: 
 var result = _this.HasParameter('DX');

Modify a parameter style or description. 
 example: 
 _this.ModifyParameter('MYPARM', PARMOD_STYLE, PARSTYLE_ATTRIBUTE);

Query the database ID for the given resource type and name 
 example: 
 var result = _this.QueryID(key, value)

Remove the given parameter from the current object. 
 example: 
 _this.RemoveParameter('PAR_MY');

Replace the current object with a library object 
 example: 
 _this.ReplacePart('Custom Cabinets\\Special End');

Set the value on a choice parameter. Defaults to the first item in the list if the value doesn't match. 
 example: 
 _this.SetChoiceValue('PAR_CHOICE', 99);

Set the material on the current object. 
 example: 
 _this.SetMaterial('3/4 Oak Ply');

Set a parameter with a value 
 example: 
 _this.SetParameter('PAR_MY', 23.5);

Set a parameter with an equation 
 example: 
 _this.SetParameter('MY-PAR', DX / 2);

Set a new parent for the current object 
 example: 
 _this.SetParent(_cab);
